$_MODULE['<{ets_cfultimate}prestashop>help_78a1949268ace1fc7465c3ccd5782138'] = 'Stáhněte si dokumentaci';
$_MODULE['<{ets_cfultimate}prestashop>help_23bb01fa352f947c152ce3084ba40373'] = 'Níže jsou uvedeny některé poznámky, kterým byste měli věnovat pozornost při používání [1]Contact Form Ultimate:[/1]';
$_MODULE['<{ets_cfultimate}prestashop>help_55deac9cea67b28b657a3414d491a1e5'] = 'Kontaktní formuláře';
$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Pokud při vytváření nového kontaktního formuláře kliknete na odkaz [1]\"Přidat nové vstupní pole/řádek pro vytvoření kontaktního formuláře\"[/1] a vyberete vstupní pole, ve výchozím nastavení bude toto vstupní pole umístěno na plné šířka řádku (1 sloupec)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Chcete-li přidat vstupní pole reCAPTCHA, musíte nejprve povolit reCAPTCHA. Přejděte na [1]\"Nastavení > Integrace > reCAPTCHA\"[/1], povolte možnost reCAPTCHA a zadejte svůj pár klíčů.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Informace o tom, jak získat klíč webu reCAPTCHA a tajný klíč, si prosím přečtěte v naší dokumentaci modulu';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Abyste mohli odpovídat na zprávy zákazníků přímo v back office, potřebujete svou e-mailovou adresu zákazníka. Při vytváření kontaktního formuláře nezapomeňte přidat pole pro zadání e-mailu a označit jej jako povinné pole.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Konfigurace e-mailu';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Chcete-li získat informace z kontaktního formuláře na e-mail zaslaný na adresu správce nebo e-mail s automatickou odpovědí, zkopírujte a vložte příslušné e-mailové značky do pole [1]\"Tělo zprávy\"[/1] v [1]\"Kontaktní formuláře > Pošta Podkarta[/1]';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Chcete-li od zákazníka obdržet soubor přílohy e-mailem, přejděte na [1]\"Kontaktní formuláře > Pošta\"[/1] a zaškrtněte políčko [1]\"Soubor přílohy\"[/1].';
$_MODULE['<{ets_cfultimate}prestashop>help_7f83c7fcf109140ce437c3822fa1ce7a'] = 'Chcete-li od zákazníka obdržet soubor přílohy prostřednictvím karty „Zprávy“, přejděte prosím na [1]„Kontaktní formuláře > Nastavení“[/1] a zapněte možnost [1]„Ukládat přílohy“[/1].';
